// SPDX-License-Identifier: MIT
pragma solidity ^0.8;

contract MergeSortedArray{

    function MergeArray(int[] memory arr1,int[] memory arr2) public pure returns(int[] memory){
        uint m = arr1.length;
        uint n = arr2.length;
        //uint length = m+n;
        int[] memory result = new int[](m+n);

        uint i = 0;
        uint j = 0;
        uint k =0;

       while (i < arr1.length&& j <arr2.length)
       {
        if(arr1[i] <arr2[j])
        {
            result[k] = arr1[i];
            i++;
        }
        else {
            result[k] = arr2[j];
            j++;
        }
        k++;

       }

       while (i < arr1.length)
       {
            result[k] = arr1[i];
            i++;
            k++;

       }

       while (j< arr2.length) 
       {
        result[k] = arr2[j];
        j++;
        k++;
       }
        return  result;
    }
}

